import Mycontacts from "../components/Contents/Mycontacts";
import FooterTag from "../components/Layout/FooterTag";

const Contact = () => {
  return (
    <div>
      <div>
        <Mycontacts />
        <FooterTag />
      </div>
    </div>
  );
};

export default Contact;
